import React, { Component } from 'react'

export default class Body extends Component {
  state = {
    courseList: [],
    name: "rudra"
  }
  componentDidMount() {

    fetch('https://reqres.in/api/users?page=2')
      .then(response => response.json())
      .then(json => {
        console.log(json)
        console.log(this.state)
        this.setState({name:"mani"})
        console.log(this.state)
      })

  }
  
  render() {
    return (
      <div>
        <table className='table table-hover-dark'>
          <thead>
            <tr>
              <th>
                id
              </th>
              <th>
                feee
              </th>
              <th>
                trainer
              </th>
              <th>
                Student
              </th>
            </tr>
          </thead>
          <tbody>
            {this.state.courseList.map((value, index) => {
              return (
                <tr key={index}>
                  <td>{value.Id}</td>
                  <td>{value.feee}</td>
                  <td>{value.trainer}</td>
                  <td>{value.student}</td>
                </tr>
              )
            })}
          </tbody>
        </table>
        
      </div>
    )
  }
}
